import React from "react";
import style from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

const Dialogs = () => {
    return (
        <div className={style.dialogWindow}>
            <div className={style.dialogs}>
                <div className={style.dialog}>
                    <NavLink to='messages/1'>Victor</NavLink>
                </div>
                <div className={style.dialog}>Sveta</div>
                <div className={style.dialog}>Eugene</div>
                <div className={style.dialog}>Artem</div>
                <div className={style.dialog}>Liza</div>
                <div className={style.dialog}>Tanya</div>
            </div>
            <div className={style.messages}>
                <div className={style.msg}>Message1</div>
                <div className={style.msg}>Message2</div>
                <div className={style.msg}>Message3</div>
            </div>
        </div>
    )
}

export default Dialogs;
